Keybanc analyst sees $AMD benefiting from robust demand in the cloud data center, with increased deployment at CSPs, notably $MSFT Azure. It sees strength in the data center to more than offset softness in PCs and graphics.   

&quot;Through our collaboration with $MSFT Azure, we help cloud customers unlock performance and gain more value from their IT investment. Together, $AMD and Azure enable world-class capabilities across high-performance computing, visualization, and enterprise workloads.&quot; 

Forrest Norrod, Senior Vice President and General Manager of the Datacenter and Embedded Solutions Business Group at AMD
